pragma solidity ^0.8.24;
import "./Token.sol";
contract Exchange {
    //收费的账户地址
    address public feeAccount;
    uint public feePercent;  //费率
    address  constant ETHER = address(0);

    struct _Order {
         uint id;
         address user;
         address tokenGet;
         uint amountGet;
         address tokenGive;
         uint  amountGive;
         uint timestamp;
    }

    mapping(address=> mapping(address=>uint)) public tokens;
    mapping(uint => _Order) public orders;
    uint public orderCount;

    mapping(uint=> bool) public orderCancel;
    mapping(uint=> bool) public orderFill;

    event Depost(address token, address user, uint amount, uint blance);
    event Withdraw(address token, address user, uint amount, uint blance);
    event Order(uint id,address user,address _tokenGet, uint _amountGet,address _tokenGive,uint _amountGive,uint timestamp);
    event Cancel(uint id,address user,address _tokenGet, uint _amountGet,address _tokenGive,uint _amountGive,uint timestamp);
    event Trade(uint id,address user,address _tokenGet, uint _amountGet,address _tokenGive,uint _amountGive,uint timestamp);

    constructor(address _feeAccount, uint _feePercent) {
        feeAccount = _feeAccount;
        feePercent = _feePercent;
    }

    function depositEther () payable public {
        tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender] + msg.value;
        emit Depost(ETHER,msg.sender,msg.value,tokens[ETHER][msg.sender]);
    }

    function depositToken (address _token, uint _amount) public {
        require(_token!= address(0),'unvalid token');
        require(Token(_token).transferFrom(msg.sender,address(this),_amount),'trans fail');
        tokens[_token][msg.sender] = tokens[_token][msg.sender] + _amount;
        emit Depost(_token,msg.sender,_amount,tokens[_token][msg.sender]);
    }

    function  withdrawEther (uint _amount) payable public {
        require(tokens[ETHER][msg.sender] >= _amount,'amount is no enough ') ;
         tokens[ETHER][msg.sender] = tokens[ETHER][msg.sender] - _amount;
         payable(msg.sender).transfer(_amount);
         emit Withdraw(ETHER,msg.sender,_amount,tokens[ETHER][msg.sender]);
    }

    function  withdrawToken(address _token,uint _amount)  public {
        require(tokens[_token][msg.sender] >= _amount,'amount is no enough ') ;
         tokens[_token][msg.sender] = tokens[_token][msg.sender] - _amount;
         Token(_token).transfer(msg.sender,_amount);
         emit Withdraw(_token,msg.sender,_amount,tokens[_token][msg.sender]);
    }

    function balanceOf(address _token,address _user) public view  returns(uint) {
        return tokens[_token][_user];
    }

    // makerOrder 
    function markOrder (address _tokenGet, uint _amountGet,address _tokenGive,uint _amountGive) public {
        orderCount +=1;
        orders[orderCount] = _Order(orderCount,msg.sender,_tokenGet,_amountGet,_tokenGive,_amountGive,block.timestamp);
        emit Order(orderCount,msg.sender,_tokenGet,_amountGet,_tokenGive,_amountGive,block.timestamp);
    }

    function cancelOrder (uint _id) public {
        _Order memory myorder = orders[_id];
        require(_id ==myorder.id,'no valid order');
        orderCancel[_id] = true;
        emit Cancel(_id, msg.sender,myorder.tokenGet,myorder.amountGet,myorder.tokenGive,myorder.amountGive,block.timestamp);
    }
    // 交易合约

    function fillOrder (uint _id) public {
          _Order memory myorder = orders[_id];
        require(_id == myorder.id,'no valid order');
        orderFill[_id] = true;

       uint feeAmount = myorder.amountGet * (feePercent/100);

        tokens[myorder.tokenGet][msg.sender] = tokens[myorder.tokenGet][msg.sender]- myorder.amountGet;
        tokens[myorder.tokenGet][myorder.user] = tokens[myorder.tokenGet][myorder.user] + myorder.amountGet;

        tokens[myorder.tokenGet][msg.sender] =  tokens[myorder.tokenGet][msg.sender]  -  feeAmount;
        tokens[myorder.tokenGet][feeAccount] =  tokens[myorder.tokenGet][feeAccount]  +  feeAmount;


        tokens[myorder.tokenGive][msg.sender] = tokens[myorder.tokenGive][msg.sender] + myorder.amountGive;
        tokens[myorder.tokenGive][myorder.user] = tokens[myorder.tokenGive][myorder.user]- myorder.amountGive;



        emit Trade(_id, msg.sender,myorder.tokenGet,myorder.amountGet,myorder.tokenGive,myorder.amountGive,block.timestamp);
    }
}","keccak256":"0x1b74c816568337978be107b9d5dd8752f364de2816c9d236bfdb0422211abe91","license":"UNLICENSED"},"contracts/Token.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;
import './Utils.sol';

contract Token is Utils{
    /* 公共变量 */
    string public name = ''; //代币名称
    string public symbol = ''; //代币符号
    uint8 public decimals = 0;  //代币单位
    uint256 public totalSupply = 10000; //代币总量

    /*记录所有余额的映射*/
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;

    /* 在区块链上创建一个事件，用以通知客户端*/
    event Transfer(address indexed from, address indexed to, uint256 value);  //转帐通知事件
    event Approval(address indexed _owner, address indexed _spender, uint256 _value); //设置允许用户支付最大金额通知

    /* 初始化合约，并且把初始的所有代币都给这合约的创建者
     * @param tokenName 代币名称
     * @param tokenSymbol 代币符号
     * @param decimalsUnits 代币后面的单位，小数点后面多少个0，以太币一样后面是是18个0
     */
    constructor(string memory tokenName, string memory tokenSymbol, uint8 decimalsUnits) {
        // require(bytes(tokenName).length > 0 && bytes(tokenSymbol).length > 0); // validate input
        name = tokenName;
        symbol = tokenSymbol;
        decimals = decimalsUnits;
        balanceOf[msg.sender] = 10000 * 10 ** decimals;
    }

    /**
     * 私有方法从一个帐户发送给另一个帐户代币
     * @param  _from address 发送代币的地址
     * @param  _to address 接受代币的地址
     * @param  _value uint256 接受代币的数量
     */
    function _transfer(address _from, address _to, uint256 _value)
      internal
      validAddress(_from)
      validAddress(_to)
    {


      //检查发送者是否拥有足够余额
      require(balanceOf[_from] >= _value);

      //检查是否溢出
      require(balanceOf[_to] + _value > balanceOf[_to]);

      //保存数据用于后面的判断
      uint previousBalances = safeAdd(balanceOf[_from], balanceOf[_to]);

      //从发送者减掉发送额
      balanceOf[_from] = safeSub(balanceOf[_from], _value);

      //给接收者加上相同的量
      balanceOf[_to] += safeAdd(balanceOf[_to], _value);

      //通知任何监听该交易的客户端
      emit Transfer(_from, _to, _value);

      //判断买、卖双方的数据是否和转换前一致
      assert(balanceOf[_from] + balanceOf[_to] == previousBalances);

    }

    /**
     * 从主帐户合约调用者发送给别人代币
     * @param  _to address 接受代币的地址
     * @param  _value uint256 接受代币的数量
     */
    function transfer(address _to, uint256 _value)
      public
      validAddress(_to)
      returns (bool)
    {
        _transfer(msg.sender, _to, _value);
        return true;
    }

    /**
     * 从某个指定的帐户中，向另一个帐户发送代币
     *
     * 调用过程，会检查设置的允许最大交易额
     *
     * @param  _from address 发送者地址
     * @param  _to address 接受者地址
     * @param  _value uint256 要转移的代币数量
     * @return        是否交易成功
     */
    function transferFrom(address _from, address _to, uint256 _value)
        public
        validAddress(_from)
        validAddress(_to)
        returns (bool)
    {
        //检查发送者是否拥有足够余额支出的设置
        require(_value <= allowance[_from][msg.sender], '-invalid value');   // Check allowance

        allowance[_from][msg.sender] -= safeSub(allowance[_from][msg.sender], _value);

        _transfer(_from, _to, _value);

        return true;
    }

    /**
     * 设置帐户允许支付的最大金额
     *
     * 一般在智能合约的时候，避免支付过多，造成风险
     *
     * @param _spender 帐户地址
     * @param _value 金额
     */
    function approve(address _spender, uint256 _value)
        public
        validAddress(_spender)
        returns (bool success)
    {

        require(_value == 0 || allowance[msg.sender][_spender] == 0, 'fail valid');

        allowance[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value);
        return true;
    }


     function allowanceOf(address _add1, address _add2)
        public view
        returns (uint256)
    {
        return allowance[_add1][_add2];

    }
}","keccak256":"0xf826dc7cf72d58e5312c6a118d537de2f418afa44528d9cb3ea08fabbc34b785","license":"UNLICENSED"},"contracts/Utils.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

/*
    Utilities & Common Modifiers
*/
contract Utils {
    // verifies that an amount is greater than zero
    modifier greaterThanZero(uint256 _amount) {
        require(_amount > 0);
        _;
    }

    // validates an address - currently only checks that it isn't null
    modifier validAddress(address _address) {
        require(_address != address(0));
        _;
    }

    // verifies that the address is different than this contract address
    modifier notThis(address _address) {
        require(_address != address(this));
        _;
    }

    // Overflow protected math functions

    /**
        @dev returns the sum of _x and _y, asserts if the calculation overflows

        @param _x   value 1
        @param _y   value 2

        @return sum
    */
    function safeAdd(uint256 _x, uint256 _y) internal pure returns (uint256) {
        uint256 z = _x + _y;
        assert(z >= _x);
        return z;
    }

    /**
        @dev returns the difference of _x minus _y, asserts if the subtraction results in a negative number

        @param _x   minuend
        @param _y   subtrahend

        @return difference
    */
    function safeSub(uint256 _x, uint256 _y) internal pure returns (uint256) {
        assert(_x >= _y);
        return _x - _y;
    }

    /**
        @dev returns the product of multiplying _x by _y, asserts if the calculation overflows

        @param _x   factor 1
        @param _y   factor 2

        @return product
    */
    function safeMul(uint256 _x, uint256 _y) internal pure returns (uint256) {
        uint256 z = _x * _y;
        assert(_x == 0 || z / _x == _y);
        return z;
    }
}","keccak256":"0x4732c21e3ad6a53ac4e77dd91c0efb5d1fe202296a821abd1bc967395bc0add9","license":"UNLICENSED"}},"version":1}
